                <a href="#" className="col-1 m-1 ms-5 border-bottom border-light">Blogs</a>
                <a href="#" className="col-1 m-1 ms-5 border-bottom border-light">Contact Me</a>
            </navBar>
            <div id="splash" class="container-fluid">
                <div id="pleaseWork"></div>
